let twosums = function(nums,target){
    a = new Map();
    for(i=0; i<nums.length;i++){
        let op = target - nums[i];
        if(a.has(op)){
            return[a.get(op),i]
        }
        a.set(nums[i], i)
        
    }
    
    return []
}
let st =  twosums(nums,target);
